*/

// @mui material components
import Card from "@mui/material/Card";
import Grid from "@mui/material/Grid";

// Soft UI Dashboard PRO React components
import SuiBox from "components/SuiBox";
import SuiTypography from "components/SuiTypography";

// Soft UI Dashboard PRO React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
import Footer from "examples/Footer";
// import DataTable from "examples/Tables/DataTable";

// ProductPage page components
// import ProductImages from "layouts/ecommerce/products/product-page/components/ProductImages";
// import ProductInfo from "layouts/ecommerce/products/product-page/components/ProductInfo";

// Data
// import dataTableData from "layouts/ecommerce/products/product-page/data/dataTableData";

import 'bootstrap/dist/css/bootstrap.min.css';
import { Table } from 'react-bootstrap';
 import { Form } from 'react-bootstrap';

function ProductPage() {
  return (
    <DashboardLayout>
      <DashboardNavbar />
      <SuiBox py={3}>
        <Card className="overflow-visible">
          <SuiBox p={3}>
            <SuiBox mb={3}>
              <SuiTypography variant="h4" fontWeight="medium" style={{ color: 'green' }} >
                User(965)
              </SuiTypography>
            </SuiBox>

            <Grid container spacing={1}>
              {/* <Grid item xs={12} lg={6} xl={5}>
                <ProductImages />
              </Grid>
              <Grid item xs={12} lg={5} className="mx-auto">
                <ProductInfo />
              </Grid> */}
              <Form.Label htmlFor="inputPassword5">Password</Form.Label>
              <Form.Control
                type="password"
                id="inputPassword5"
                aria-describedby="passwordHelpBlock"
              />
              <Form.Text id="passwordHelpBlock" muted>
                Your password must be 8-20 characters long, contain letters and numbers, and
                must not contain spaces, special characters, or emoji.
              </Form.Text>
            </Grid>

            <SuiBox mt={8} mb={2}>
              {/* <SuiBox mb={1} ml={2}>
                <SuiTypography variant="h5" fontWeight="medium">
                  Other Products
                </SuiTypography>
              </SuiBox> */}
              {/* <DataTable
                table={dataTableData}
                entriesPerPage={false}
                showTotalEntries={false}
                isSorted={false}
              /> */}
              <Table striped bordered hover>
                <thead>
                  <tr>
                    <th>#</th>
                    <th>First Name</th>
                    <th>Last Name</th>
                    <th>Username</th>
                  </tr>
                </thead>
                <tbody>
                  <tr>
                    <td>1</td>
                    <td>Mark</td>
                    <td>Otto</td>
                    <td>@mdo</td>
                  </tr>
                  <tr>
                    <td>2</td>
                    <td>Jacob</td>
                    <td>Thornton</td>
                    <td>@fat</td>
                  </tr>
                  <tr>
                    <td>3</td>
                    <td colSpan={2}>Larry the Bird</td>
                    <td>@twitter</td>
                  </tr>
                </tbody>
              </Table>
            </SuiBox>
          </SuiBox>
        </Card>
      </SuiBox>
      <Footer />
    </DashboardLayout>
  );
}

export default ProductPage;
